  {
   "cell_type": "markdown",
   "metadata": {},
   "source": [
    "1.The data is represented by months in 'NFLX.csv' and 'DJI.csv' files. The data in 'NFLX_daily_by_quarter.csv' is recorded by days.\n",
    "\n",
    "2.The difference is that in netflix stocks we have aggregated data by months and in in netflix_stocks_quarterly aggregated by days."
   ]
  },
